import React from "react";
import AboutPic from "../../images/portfolio2min.png"
import "./about.css";

const About = () => {
  return (
    <div>
      <div uk-grid>
    <div class="uk-grid-item-match"></div>
    <div></div>
</div>
      <img
        src={AboutPic}
        alt="elizabeth regas"
        className="aboutPic"
      ></img>
      <p className="aboutText">Eliza</p>
    </div>
  );
};

export default About;
